import courseModel from "../data";

export default function StudentDashboard(){
    const findCourse = courseModel.filter(({students}) =>  {
        return students.some(({name}) => name === "Manav Singh");
    });

    const enrolledCourse = findCourse.map(({name, instructor, thumbnail}) => {
        return(
            <div>
                <h2>{name}</h2>
                <img alt="course" src=""/>
                <p>Instructor: {instructor}</p>
                <p>Due date: 23rd Feb, 2024</p>
                <p>Progress bar========70%</p>
            </div>
        );
    })
    return(
        <div>
            <img alt="student alias" src=""/>
            <div>
                <h2>Manav Singh</h2>
                <p>A computer science graduate, who loves to code and play with computers.</p>
                <p>Email: manav@example.com</p>
            </div>
            {enrolledCourse}
        </div>
    );
}
